    false,nt"url": null,nt"notes": "This Comprehensive Conservation Plan (CCP)
    was written to guide management on Minnesota Valley NWR and Wetland Management District
    for the next 15 years. This plan outlines the Refuge and WMD vision and purpose
    and describes how Minnesota Valley NWR and Wetland Management District will contribute
    to the overall mission of the Refuge System. The plan provides an introduction to
    the Refuge and the WMD, an overview of the CCP process, information about the environment,
    information about the management direction, and strategies for implementation. Key
    planning issues include: recreational uses, environmental education, habitat management,
    land acquisition, mosquito control, and infrastructure.",nt"license_title":
